import classes from './css/Contact.module.css'

function ContactPage () {
    return (
        <div>
            <h1>ติดต่อเรา</h1>
            <iframe style = {{width: "500px", height: "350px"}} title="FIBO" src="https://maps.google.com/maps?width=600&amp;height=400&amp;hl=en&amp;q=Institute of field robotics&amp;t=p&amp;z=14&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"></iframe>
            <p className = {classes.name}>Goose Good, Inc</p>
            <p></p>
        </div>
    );
}

export default ContactPage;
